INSERT INTO `tblProducts` (`idProduct`, `idClient`, `idBusinessCategory`, `ProductName`, `ProdcuctDescription`, `ProdcuctEspecification`, `flagExcluido`, `Category`, `certificado`) VALUES
(79, 38, 7, 'Straight PediGuard', '- Straight tip\r\n- Assist surgeons in preparing the pedicle for screw placement at any level of the spine\r\n- CE marked and FDA cleared       ', '3 different diameters: Ø2.5 mm, Ø3.2 mm and Ø4.0 mm', 0, 2, 0),
(81, 38, 7, 'Curved PediGuard', '- Ease penetration through the pedicle and removal thanks to the tapered tip\r\n\r\n- Ease redirection during pedicle drilling: as surgeons become comfortable with the direction of the curve, they can be aware of the location of a possible breach, and hence allow proper redirection\r\n\r\n- Mainly used in thoracic and lumbar, especially for deformity\r\n\r\n- CE marked and FDA cleared  ', '2 different diameters: Ø3.6 mm and Ø4.0 mm', 0, 2, 0),
(82, 39, 10, 'VAScuease (ic-1200-wh)', 'Portable equipment intended to the Deep Venous Thrombosis Prophylaxis for non-ambulatory patients both in the hospital setting and at home.    ', '• One button operation\r\n• Compact and fully portable\r\n• No cumbersome tubes\r\n• Sealed re-chargeable battery with duration of 20 hours\r\n• Compliance Meter\r\n• Soft-touch, washable, breathable sleeve\r\n• Adjustable grip strip for a perfect fit', 0, 2, 0),
(83, 38, 8, 'Cannulated PediGuard', '- Progressive diameter of the Needle to ease the insertion and removal\r\n\r\n- Graduated shaft to control the progression into the bone\r\n\r\n- Designed primarily for helping surgeons reduce radiation exposure during minimally-invasive procedures\r\n\r\n-Can also be used to access and drill narrow and small pedicles\r\n\r\n- CE marked and FDA cleared     ', '2 types of tips (bevel and trocar)\r\n\r\nNeedle available in 2 sizes (120mm and 160mm) – the longest PediGuard instrument/shaft', 0, 2, 0),
(84, 39, 10, 'BIOCRYO (SC-2004-DL-OTC).', 'BioCryo technology provides cold compression therapy system which combines active cold and sequential compression therapies to provide maximum power to manage pain, reduce inflammation, and speed healing for a wide variety of ailments.      ', '• 4 chamber compression therapy\r\n• Unilateral or bilateral capability\r\n• Adjustable pressure between 20 mmHg and 120 mmHg\r\n• Adjustable cycle time between 60 and 120 seconds\r\n• Built in countdown timer or continuous mode\r\n• Focus Therapy • Pause Button • Compliance Meter', 0, 2, 0),
(86, 38, 7, 'Threaded PediGuard', '- Stiff drilling instrument that may be used to streamline surgical steps while maintaining the accuracy for pedicle preparation for screw placement\r\n\r\n- Potential reduction of the use of intraoperative imaging in standard and MIS procedures\r\n- CE marked and FDA cleared for posterior pedicle screw drillings\r\nFDA cleared for vertebral body drillings by anterior approach ', '- 3 diameters: Ø4.0mm, Ø4.5mm and Ø5.5mm', 0, 2, 0),
(87, 36, 8, 'KESTAL LONG EXOFOOT ', 'Discover the innovation and comfort of Exofoot Kestal, the perfect Ankle and Foot Immobilizer for treating ankle and foot injuries. With a non-slip sole for safe walking, its rounded shape ensures a smooth and comfortable gait. The adjustable fastener provides precise and comfortable fit. Ideal for the recovery of muscle and joint injuries, replacing traditional casts.       ', 'Available in black and gray, black and yellow, gray and gray, the long exofoot boot comes in sizes S, M and L. \r\nIts composition is made up of a 100% polyamide base; and its lining is made up of 70% polyurethane foam and 30% polyester ', 0, 2, 0),
(88, 39, 10, 'bio arterial (ic-bap-dl)', 'The Bio Arterial Plus provides arterial blood flow enhancement indicated for  non- healing wounds; Graft failure; Intermittent claudication; Rest pain; Peripheral arterial disease; Diabetic foot ', '• Either timed treatment or continuous mode \r\n• Adjustable pressure\r\n• Compliance meter\r\n• Dimensions: 5.5\" x 12\" x 8\" /  14 cm x 30 cm x 20 cm\r\n• Weight: 7.5 lbs / 3.4 kg\r\n• Compression Time: 5 seconds\r\n• Non-Compression Time: 15 seconds\r\n• Delay: Between Foot & Calf: 1 second \r\n• Cycle: 20 seconds\r\n• Pressure Range: 10 - 150 mmHg', 0, 2, 0),
(89, 36, 8, 'The kestal shapewear belt ', 'The Kestal Shapewear Belt is the perfect solution for maintaining an elegant posture and waist slimming. Made of neoprene, it provides body warmth and features two levels of compression for a comfortable fit. Both men and women can wear it during the day, especially during exercise, to support the spine, improve posture, and accentuate their curves. Additionally, it has a thermal effect that warms the abdominal and lumbar region, making it useful for post-abdominal surgery recovery. Crafted from   ', 'Available in black and pink\r\nThe shaping belt varies between sizes M and L, based on the centimeters of waist circumference: \r\nM - (75-96)\r\nL - (85-106)\r\nComposed of 85% styrene-butadiene rubber and 15% polyamide', 0, 2, 0),
(93, 36, 8, 'The sensi wrist - the strap loop ', 'Experience the relief and convenience of Sensi Wrist to gain wrist stability and alleviate pain. With 2 molded splints and intelligent design, it facilitates accelerated recovery while keeping your fingers free for your daily activities. Ideal for preventing and treating RSI, WRULD, Carpal Tunnel Syndrome, tendonitis, tenosynovitis, sprains, fractures, and posture correction.   ', 'The Sensi Wrist - The Strap Loop varies between sizes S, M and L, available in right and left options:\r\n14cm - 16cm (S)\r\n17cm - 19cm (M)\r\n20cm - 22cm (L)\r\nIt is made of 77% polyester and 23% polyurethane foam. The upper splint is made of 100% polypropylene, while the lower splint is made of 100% polyamide.', 0, 2, 0),
(94, 30, 24, 'Suporte', '<span style=\"font-weight: normal;\">SUPORTE teste </span>teste <span style=\"font-weight: normal;\">ASD ASD ASD</span>', '', 0, 9, 0),
(102, 28, 1, 'teste', 'tete       ', '', 0, 2, 0),
(103, 31, 5, 'Natysa Brainds', 'Trikovokjvnmosdkmfvo     ', '', 0, 2, 0),
(106, 28, 2, 'TESTE DE PRODUTOS', 'TESTE', '', 0, 3, 0),
(107, 28, 2, 'TESTE 2', 'LUCAS', '<p><br></p><table class=\"table table-bordered\"><tbody><tr><td><p>OI</p><span style=\"background-color: rgb(255, 255, 0);\">OIOI</span><table class=\"table table-bordered\"><tbody><tr><td>I</td><td>IO</td><td>IO</td><td><u>OIOI</u></td><td>IO</td></tr></tbody></table><p><br></p></td></tr></tbody></table><p><br></p>', 0, 3, 0),
(108, 48, 12, 'Regulatory Affair Consulting & Management', 'Tailor your Latin America registration strategy approach to align with your long-term market strategy ', '<p><span class=\"OYPEnA text-decoration-none text-strikethrough-none\" style=\"color: rgb(66, 66, 66);\">Regulatory Assessment & Consulting</span></p><p><span class=\"OYPEnA text-decoration-none text-strikethrough-none\" style=\"color: rgb(66, 66, 66);\">Tailored Registration Strategies</span></p><p><span class=\"OYPEnA text-decoration-none text-strikethrough-none\" style=\"color: rgb(66, 66, 66);\">Product Registration Management</span></p><p><span class=\"OYPEnA text-decoration-none text-strikethrough-none\" style=\"color: rgb(66, 66, 66);\">Sanitary Product Registration Hosting*</span></p><p><span class=\"OYPEnA text-decoration-none text-strikethrough-none\" style=\"color: rgb(66, 66, 66);\">Surveillance and Traceability Processes & Management</span></p><p><span class=\"OYPEnA text-decoration-none text-strikethrough-none\" style=\"color: rgb(66, 66, 66);\">Comprehensive Testing & Technical Report**</span></p><ul><li><span class=\"OYPEnA text-decoration-none text-strikethrough-none\" style=\"background-color: inherit; color: rgb(156, 0, 0);\"><br></span></li><li style=\"line-height: 22px;\"><span class=\"OYPEnA text-decoration-none text-strikethrough-none\" style=\"background-color: inherit; color: rgb(156, 0, 0);\">*Brazil, Mexico, Peru, Costa Rica, Ecuador & Colombia</span></li><li><span style=\"background-color: inherit; color: rgb(156, 0, 0);\"><span class=\"OYPEnA text-decoration-none text-strikethrough-none\"></span><span class=\"OYPEnA text-decoration-none text-strikethrough-none white-space-prewrap\"></span></span></li><li style=\"line-height: 22px;\"><span class=\"OYPEnA text-decoration-none text-strikethrough-none\" style=\"background-color: inherit; color: rgb(156, 0, 0);\">**Including mechanical, dimensional, and more, to ensure market clearance.</span></li></ul>', 0, 11, 0),
(109, 30, 9, 'teste', '<p><span style=\"background-color: rgb(255, 255, 0);\">teste</span></p>', '<p>teste</p>', 0, 24, 0),
(111, 48, 12, 'Edutech Medical', '<p style=\"font-size: 12.000001px;\"><span style=\"font-weight: normal;\">Empower your distributors with enhanced product knowledge.</span></p><p style=\"font-size: 12.000001px;\"><span style=\"font-weight: normal;\">Captivate the attention of your distributor\'s sellers and watch tailored education propel your sales to new heights in record time.</span></p><p><span style=\"font-weight: normal; font-size: 12.000001px; text-align: var(--bs-body-text-align);\">Investing in education yields the highest ROI for your business, ensuring success in both the short and long term.</span><br></p>  ', '<p style=\"font-size: 12.000001px;\"><span style=\"font-weight: normal;\">• Tailored Training precision-crafeted for every</span></p><p style=\"font-size: 12.000001px;\"><span style=\"font-weight: normal;\">challenge</span></p><p style=\"font-size: 12.000001px;\"><span style=\"font-weight: normal;\">• Sharpening the skills of your distributor sales team</span></p><p style=\"font-size: 12.000001px;\"><span style=\"font-weight: normal;\">Continuous education program with your specific</span></p><p style=\"font-size: 12.000001px;\"><span style=\"font-weight: normal;\">target audience</span></p><p style=\"font-size: 12.000001px;\"><span style=\"font-weight: normal;\">• Amplify your product\'s share-of-mind where it most</span></p><p style=\"font-size: 12.000001px;\"><span style=\"font-weight: normal;\">matter: in the mind of the distributor\'s sales rep!</span></p>', 0, 11, 0),
(112, 30, 2, 'Produto ', '<p>Teste</p>', '<p>Teste&nbsp;</p>', 0, 4, 0),
(113, 48, 11, 'Overseas Distributor Management', '<p>dcadfadf</p>', '<p>Effectively overseeing your distribution network from the central hub of operations, with local experts who speak the language, share the same time zone, and comprehend your clients\' culture, often results in superior and faster outcomes.</p><p>', 0, 12, 0),
