(28, 'LUCAS 2', NULL, 'SOUZA', 'CEO', 384, 'SILVA TECH SOUZA', 'decef631657ea1ca91e58fade7c89794', '2023-11-01 13:12:46', 2, 1, 12, 'representante.sts@silvatechsouza.com.br', 1, 1, 'assets/img/28/PersonalUser_28.png', 'assets/img/28/LogoPicture_28.png', '+5511911601652', '<h4><b><u>Nossa jornada começou em 2019, </u></b></h4><p><span style=\"font-weight: normal;\">num quarto com um computador e uma chama inextinguível. O que parecia improvável tornou-se nossa faísca, inflamando a paixão pela criação de soluções inteligentes e intuitivas. Embora não dispuséssemos das ferramentas mais avançadas, a determinação transbordava. A cada obstáculo, vislumbramos uma oportunidade para inovar, para moldar o futuro digital. Hoje, a Silva Tech Souza é a materialização desses esforços incansáveis. Uma equipe unida e diversificada, movida por uma visão: democratizar a complexidade e tornar a inovação tangível. Reconhecemos o poder de transformar uma ideia numa jornada digital excepcional. Criamos aplicativos que transcendem códigos, abrindo portais para conquistas</span></p>', '51.517.599/0001-76', '2023-11-09', '1', '1', '1', NULL, '2020', 1, '2021', 1, '2022', 1, NULL, NULL, 40870, 2020, 1, 2021, 1, 2022, 1),
