(31, 'Julio', NULL, 'costa nunes', 'Developer', 384, 'STS', 'ed6e99a86dd25d938c252c9667987a44', '2023-11-01 14:02:15', 3, 8, 344, 'julio.costa-nunes@unesp.br', 1, 1, 'assets/img/31/PersonalUser_31.png', 'assets/img/31/LogoPicture_31.png', '65106561561615615616', 'dzfghfghjfgjfdgh', '151956119561596', '2020-01-05', '1', '1', '2', NULL, '2020', 5, '2021', 4, '2022', 4, NULL, NULL, 9320, 2020, 4, 2021, 6, 2022, 5),
(35, 'Nome', NULL, 'acascas', 'Developer', 384, 'STS', '9b405d4408c38aeaab25d8e77bd3baad', '2023-11-04 19:41:25', 3, 8, 344, 'tenishi1cn@gmail.com', 1, 1, NULL, NULL, '199561561516515665', NULL, '51.517.599/0001-76', '2002-01-05', '1', '1', '1', NULL, '2020', 1, '2021', 1, '2022', 1, NULL, NULL, 200, 2020, 1, 2021, 1, 2022, 1),
(36, 'alissia', NULL, 'maia', 'International Sales Coordinator', 384, 'Kestal ', 'de725ff3e39bf82b39efe73158266102', '2023-11-06 14:58:45', 2, 8, 335, 'sales.latam.1@latambd.com.br', 1, 1, 'assets/img/36/PersonalUser_36.jpg', NULL, '+55 11 94331-0303', 'Kestal is a Brazilian manufacturer of soft orthopedics & fitness accessories. It is also a vegan and cruelty-free manufacturer, with products manufactured especially for the patient\'s quality of life and comfort. In addition, our products offer high quality due to its differentiated raw material at competitive prices. ', '09.408.413/0001-84', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 4010, NULL, NULL, NULL, NULL, NULL, NULL),
(38, 'Miquely', NULL, 'Zacarias', 'sALES COORDINATOR', 384, 'Spineguard sa', 'd229680577c5d9dd57a0e9d2ac3539a3', '2023-11-06 15:00:22', 2, 8, 391, 'sales.latam.2@latambd.com.br', 1, 1, 'assets/img/38/PersonalUser_38.png', 'assets/img/38/LogoPicture_38.png', '+55 11 91555-0327', 'SpineGuard is an innovative company deploying its proprietary radiation-free real time sensing technology DSG® (Dynamic Surgical Guidance) to secure and streamline the placement of implants in the skeleton.\r\n\r\nOur Vision:\r\nPierre Jérôme and Stéphane Bette founded SpineGuard in 2009 with the idea of delivering the clinical benefits of the DSG® (Dynamic Surgical Guidance) technology to as many patients as possible. SpineGuard’s primary goal is to establish the DSG technology as a standard of care to SECURE AND STREAMLINE SKELETAL IMPLANT PLACEMENT for the benefit of patients, surgeons, operating room staff, healthcare providers and SpineGuard’s shareholders.\r\n\r\nOur Mission:\r\nSpineGuard’s mission is to help surgeons MAKE SPINE SURGERY SAFER while deploying and driving adoption of smart devices derived from its DSG platform for spine surgery and other skeletal applications in partnership with innovative medical device companies.', 'RCS510179559', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 7000, NULL, NULL, NULL, NULL, NULL, NULL),
(39, 'renan', NULL, 'Costa', 'business coordinator', 384, 'Bio compression', '4c38b9301b1038f15c22741b51f8c948', '2023-11-06 15:02:06', 2, 10, 351, 'renan.costa@latambd.com.br', 1, 1, 'assets/img/39/PersonalUser_39.png', NULL, '5511955400101', 'Bio Compression Systems has been the leading manufacturer of pneumatic compression devices for over 30 years. Compression therapy is used for the treatment of lymphedema, venous insufficiency, lipedema, phlebolymphedema, non-healing wounds, DVT prophylaxis, post-op edema and sports injuries. Based in Moonachie, NJ - our manufacturing facility is focused on quality products. Countless clinical studies prove the efficacy of our products, it\'s no wonder that patients from all over the world turn to Bio Compression to help treat their conditions. ', '22-246-9976', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3000, NULL, NULL, NULL, NULL, NULL, NULL),
(46, 'TESTETESTE__________STS', NULL, 'TESTETESTE__________STS123', 'TESTETESTE__________STS', 368, 'STS', '9b405d4408c38aeaab25d8e77bd3baad', '2023-11-06 22:15:38', 2, 6, 183, 'comercial.sts@silvatechsouza.com.br', 1, 1, NULL, NULL, '199561561516515665', NULL, '151956119561596', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(48, 'Marcelo', NULL, 'Carvalho', 'CEO', 384, 'LABD', 'decef631657ea1ca91e58fade7c89794', '2023-11-07 19:12:58', 11, 12, 0, 'marcelo.carvalho@latambd.com.br', 1, 1, 'assets/img/48/PersonalUser_48.jpg', 'assets/img/48/LogoPicture_48.png', '+5511991860812', '<p style=\"text-align: justify;\"><u>LABD</u><span style=\"font-weight: normal;\">, an integrated services platform for speeding up your business development on  healthcare products distribution in Latin American countries.\r\n\r\nAs a specialist in the healthcare market, encompassing all business processes, from the registration strategies, and market approach to sales &amp; marketing management.\r\n\r\nOur goal is more than sales, but mainly, introducing new business consistently, positioning the brand adding value, and building healthy long-term relationships with key stakeholders in each country.\r\n</span></p><p style=\"text-align: justify;\"><span style=\"font-weight: normal; font-size: larger; text-align: var(--bs-body-text-align);\">We are in all over America Latina countries.</span><br></p>', '15732890000101', '2023', '1', '1', '1', NULL, '2022', 1, '2021', 1, '2020', 1, NULL, NULL, 7910, NULL, NULL, NULL, NULL, NULL, NULL),
(49, 'Guilherme', NULL, 'Laurino', 'CEO', 384, 'Life Spine Implantes Ltda', '70cebf02824016c8560cae49660a8730', '2023-11-08 12:58:22', 4, 8, 391, 'guilherme@lifespine.com.br', 1, 1, 'assets/img/49/PersonalUser_49.png', 'assets/img/49/LogoPicture_49.png', '+5511987687776', 'Starting operations in 2002, Life Spine Implanteshas the goal of being a leader and innovator in its field of activity: the sale of products and services for the neurosurgery and spine implants segments. Life Spine is driven by the determination and\r\nboldness of its CEO, Guilherme Laurino de Andrade, who has a rare experience and deep knowledge of this market in his curriculum.\r\nWe are proud to provide the highest quality products and services that make a decisive contribution to helping people recover in less time and lead healthier lives.', '05156268000130', '2017-01-01', '6', '3', '1', NULL, '2022', 8, '2021', 7, '2020', 7, NULL, NULL, 1850, 2022, 7, 2021, 6, 2020, 6),
(51, 'Alexis', NULL, 'Damazio', 'Markerting and Procurament Manager', 384, 'Life Spine Implantes Ltda', 'c17afdc2d01cffc91a1bc82ad89e1e94', '2023-11-08 16:39:02', 12, 12, 1, 'alexis@lifespine.com.br', 1, 1, NULL, NULL, '+5511981278575', NULL, '05156268000130', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL),
